import React, { useState } from 'react';
import Header from './Header';
import Sidebar from './Sidebar';
import MainContent from './MainContent';

const Dashboard = ({ user, modules, onLogout }) => {
    const [activeModule, setActiveModule] = useState(modules[0]?.name || 'dashboard');

    return (
        <div className="dashboard-layout">
            <Header user={user} onLogout={onLogout} />
            <div className="dashboard-body">
                <Sidebar modules={modules} activeModule={activeModule} setActiveModule={setActiveModule} />
                <MainContent module={activeModule} />
            </div>
        </div>
    );
};

export default Dashboard;
